import React, { useEffect, useState } from 'react';
import jsPDF from 'jspdf';
import API from '../utils/api';

function Report({ user }) {
  const [reports, setReports] = useState([]);
  const [selectedReport, setSelectedReport] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // Pagination & Search States
  const [page, setPage] = useState(1);
  const [totalPages, setTotalPages] = useState(1);
  const [search, setSearch] = useState('');
  const [careerFilter, setCareerFilter] = useState('');

  // Edit State
  const [isEditing, setIsEditing] = useState(false);
  const [editTitle, setEditTitle] = useState('');

  useEffect(() => {
    fetchReports();
  }, [page, search, careerFilter]);

  const fetchReports = async () => {
    try {
      let query = `/reports?page=${page}&limit=5`;
      if (search) query += `&search=${search}`;
      if (careerFilter) query += `&career=${careerFilter}`;

      const res = await API.get(query);
      setReports(res.data.data);
      setTotalPages(res.data.totalPages);
    } catch (err) {
      console.error("Error fetching reports", err);
    }
  };

  const generateReport = async () => {
    setLoading(true);
    setError(null);
    try {
      const res = await API.post('/reports/generate');
      fetchReports(); // Refresh list
      setSelectedReport(res.data); // View new report
    } catch (err) {
      console.error("Error generating report", err);
      setError("Failed to generate report. Please ensure you have completed all 5 quizzes.");
    } finally {
      setLoading(false);
    }
  };

  const handleDelete = async (id) => {
    if (!window.confirm("Are you sure you want to delete this report?")) return;
    try {
      await API.delete(`/reports/${id}`);
      fetchReports();
      if (selectedReport && selectedReport._id === id) setSelectedReport(null);
    } catch (err) {
      console.error("Error deleting report", err);
    }
  };

  const handleUpdate = async () => {
    try {
      const res = await API.put(`/reports/${selectedReport._id}`, { title: editTitle });
      setSelectedReport(res.data);
      setIsEditing(false);
      fetchReports();
    } catch (err) {
      console.error("Error updating report", err);
    }
  };

  const generatePDF = (report) => {
    if (!report) return;
    const doc = new jsPDF();
    doc.setFontSize(20);
    doc.text(report.title || 'Margdarshak Career Report', 10, 20);

    doc.setFontSize(16);
    doc.text('Recommended Careers:', 10, 40);

    let y = 50;
    report.careers.forEach((career, index) => {
      doc.setFontSize(14);
      doc.text(`${index + 1}. ${career}`, 15, y);
      y += 10;
    });

    doc.setFontSize(16);
    doc.text('Roadmap:', 10, y + 20);
    y += 30;

    const roadmapLines = doc.splitTextToSize(report.roadmap, 180);
    doc.setFontSize(12);
    doc.text(roadmapLines, 15, y);

    doc.save('Margdarshak_Report.pdf');
  };

  if (loading) return <div className="section text-center"><h2>Generating your personalized report...</h2></div>;

  // Detail View
  if (selectedReport) {
    return (
      <div className="section">
        <button className="btn btn-secondary mb-2" onClick={() => setSelectedReport(null)}>‚Üê Back to Reports</button>

        <div className="text-center mb-2">
          {isEditing ? (
            <div style={{ display: 'flex', justifyContent: 'center', gap: '1rem' }}>
              <input
                type="text"
                value={editTitle}
                onChange={(e) => setEditTitle(e.target.value)}
                className="search-input"
              />
              <button className="btn" onClick={handleUpdate}>Save</button>
              <button className="btn btn-secondary" onClick={() => setIsEditing(false)}>Cancel</button>
            </div>
          ) : (
            <>
              <h2>{selectedReport.title}</h2>
              <button className="btn btn-sm btn-secondary" onClick={() => { setIsEditing(true); setEditTitle(selectedReport.title); }}>Edit Title</button>
            </>
          )}
          <p className="text-muted">Generated on {new Date(selectedReport.createdAt).toLocaleDateString()}</p>
        </div>

        <div className="report-section">
          <h3>Recommended Careers</h3>
          <div className="grid">
            {selectedReport.careers && selectedReport.careers.map((career, index) => (
              <div key={index} className="card career-card">
                <h4>{career}</h4>
              </div>
            ))}
          </div>
        </div>

        <div className="report-section">
          <h3>Your Personalized Roadmap</h3>
          <pre style={{ whiteSpace: 'pre-wrap', fontFamily: 'inherit', background: '#f8f9fa', padding: '1rem', borderRadius: '8px' }}>
            {selectedReport.roadmap}
          </pre>
        </div>

        <div className="text-center">
          <button className="btn" onClick={() => generatePDF(selectedReport)} style={{ marginRight: '1rem' }}>Download PDF</button>
        </div>
      </div>
    );
  }

  // List View
  return (
    <div className="section">
      <div className="text-center mb-2">
        <h2>Your Career Reports</h2>
        <p>View past reports or generate a new one.</p>
        <button className="btn" onClick={generateReport}>Generate New Report</button>
        {error && <div className="text-danger mt-2">{error}</div>}
      </div>

      <div className="search-container">
        <input
          type="text"
          className="search-input"
          placeholder="Search by title..."
          value={search}
          onChange={(e) => { setSearch(e.target.value); setPage(1); }}
        />
        <input
          type="text"
          className="search-input"
          placeholder="Filter by Career..."
          value={careerFilter}
          onChange={(e) => { setCareerFilter(e.target.value); setPage(1); }}
        />
      </div>

      <div className="grid">
        {reports.map((rep) => (
          <div key={rep._id} className="card">
            <h3>{rep.title}</h3>
            <p className="text-muted">{new Date(rep.createdAt).toLocaleDateString()}</p>
            <p><strong>Top Career:</strong> {rep.careers[0]}</p>
            <div style={{ marginTop: '1rem', display: 'flex', gap: '0.5rem' }}>
              <button className="btn btn-sm" onClick={() => setSelectedReport(rep)}>View</button>
              <button className="btn btn-sm btn-secondary" onClick={() => handleDelete(rep._id)}>Delete</button>
            </div>
          </div>
        ))}
      </div>

      {reports.length === 0 && <p className="text-center text-muted">No reports found.</p>}

      {totalPages > 1 && (
        <div className="text-center mt-2">
          <button className="btn" disabled={page === 1} onClick={() => setPage(page - 1)} style={{ marginRight: '10px' }}>Prev</button>
          <span>Page {page} of {totalPages}</span>
          <button className="btn" disabled={page === totalPages} onClick={() => setPage(page + 1)} style={{ marginLeft: '10px' }}>Next</button>
        </div>
      )}
    </div>
  );
}

export default Report;
